import { useEffect, useState } from 'react';
import './App.css';
import Restaurantes from './components/restaurantes'

function App() {
  state = {
    responseJSON:[]
  }
  const url = 'http://hoteloasis.vicentealdhair.com/api/oasis/centro_consumo'
  const url_todos='https://jsonplaceholder.typicode.com/users'

  const [todos,setTodos]= useState()
  const [todos_horarios,setTodos_horarios]= useState()

  const fetchApi=async()=>{
    const response= await fetch(url)
    console.log(response.status)
    const responseJSON= await response.json()
    setTodos(responseJSON)
    console.log(responseJSON)


  }
  set

  const todosApi=async()=>{
    const response= await fetch(url_todos)
    console.log(response.status)
    const responseJSON_horarios= await response.json()
    setTodos_horarios(responseJSON_horarios)
    console.log(responseJSON_horarios)

  }

  useEffect(()=>{
    fetchApi()
    todosApi()
  },[])
  return (
    <div className="App">

<Restaurantes/>

      <ul>
         {!todos? '  Cargando...' : 
      todos.map((todo,index)=>{
        return <li>{todo.nombre}</li>
      })
      }
          {!todos_horarios? '  Cargando...' : 
      todos_horarios.map((todo,index)=>{
        return <li>{todo.name}</li>
      })
      }
      </ul>

    </div>
  );
}

export default App;
